exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog");bid=bid.split("|")[1];const url=`https://www.71qs.com/123.php?m=${bid}`;return parseCatalog(url,null,{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"},parser:async html=>{const totalPages=html.subRegex(/class="last_page" href="[^"]+page=(\d+)"/),total=parseInt(totalPages)+1,result=[],base=`https://www.71qs.com/123.php?m=${bid}&page=`;for(let i=1;i<total;i++){const str=i+"";result.push({id:str,name:str,url:base+i});}return result}})};